import React from "react";
import { Link } from "react-router-dom";
import { useStoreContext } from "../../utils/GlobalState";
import TimePicker from "react-bootstrap-time-picker";

function PendingEvent() {
  const [state, dispatch] = useStoreContext();
  // add your shit here my man
  return (
    <div className="clickedEvent col-md-6">
      <div className="listCOntainer">
        <h2 className="h2">{state.currentBooking.title} ~ name here</h2>
        <ul className="ul">
          <li className="li">
            <Link to="#"> {state.currentBooking.description}</Link>
          </li>
          <li className="li">
            <Link to="#"> {state.currentBooking.location}</Link>
          </li>
          <li className="li">
            <Link to="#"> {state.currentBooking.date}</Link>
          </li>
          <li className="li">
            <TimePicker
              start="10:00"
              end="21:00"
              step={30}
              value={state.currentBooking.time}
            />
          </li>
        </ul>
      </div>
    </div>
  );
}

export default PendingEvent;
